INSERT INTO `tb_postagens` (`id`, `titulo`, `texto`, `imagem`, `data`) VALUES
(19, 'O Que é GitHub e Para Que Serve', '<h5 style=\"text-align: justify; margin-right: 0px; margin-bottom: 25px; margin-left: 0px; padding: 0px; border: 0px; zoom: 1; line-height: 1.75em; font-family: Roboto, \"><font color=\"#000000\"><span style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1; font-family: Arial;\">&nbsp; &nbsp; O GitHub é um site que abriga um software de controle de versão de desenvolvimento através do sistema Git. Falando assim, parece complicado né? Mas entender o que é GitHub e para que ele serve é mais simples do que você possa imaginar. Trata-se de um sistema que possibilita trabalhos em colaboração com outros desenvolvedores — estejam eles do seu lado ou em outro continente.<br></span><span style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1; font-family: Arial;\">&nbsp; &nbsp; Através desse sistema, duas ou mais pessoas podem editar arquivos existentes ou criar novos sem arriscar que suas alterações sejam apagadas pelas modificações de outros membros da equipe. Isso é útil para os mais diferentes tipos de projetos, mas antes de explicarmos os motivos, vamos dar um passo para trás e falar sobre Git.<br></span><span class=\"ez-toc-section\" id=\"O-Que-e-Git\" style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\"><span style=\"font-weight: 700; margin: 0px; padding: 0px; border: 0px; zoom: 1; font-family: Arial;\">O Que é Git?<br></span></span><span style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\"><span style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border-style: initial; border-color: initial; border-image: initial; transition-duration: 0.3s; transition-property: color; outline-color: initial; outline-width: initial; font-family: Arial;\">&nbsp; &nbsp; Git</span><span style=\"font-family: Arial;\">&nbsp;é um sistema distribuído de controle de versões, que permite que os usuários acompanhem mudanças no código-fonte durante o desenvolvimento de software. Existem diversas ferramentas do tipo no mercado, mas o Git é a mais popular, sendo&nbsp;</span></span><span style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border-style: initial; border-color: initial; border-image: initial; transition-duration: 0.3s; transition-property: color; outline-color: initial; outline-width: initial; font-family: Arial;\">utilizada por 42,9%</span><span style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1; font-family: Arial;\">&nbsp;dos desenvolvedores de software profissionais.<br></span><span style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\"><span style=\"font-family: Arial;\">&nbsp; &nbsp; &nbsp;Esse sistema foi criado em 2005 por Linus Torvalds, o criador do&nbsp;</span><span style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border-style: initial; border-color: initial; border-image: initial; transition-duration: 0.3s; transition-property: color; outline-color: initial; outline-width: initial; font-family: Arial;\">Linux</span><span style=\"font-family: Arial;\">, que na época precisava de uma ferramenta como essa para gerenciar o desenvolvimento do kernel junto de outros programadores que colaboravam com ele.<br></span></span><span style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\">&nbsp; &nbsp; &nbsp; Em julho do mesmo ano, porém, o gerenciamento do projeto passou para as mãos do japonês Junio Hamano – inclusive, em 2012&nbsp;</span><span style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border-style: initial; border-color: initial; border-image: initial; transition-duration: 0.3s; transition-property: color; outline-color: initial; outline-width: initial;\">Torvalds reconheceu</span><span style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\">&nbsp;o acerto que foi confiar o projeto às mãos de Hamano.<br></span><span style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Um sistema de controle de versões é bastante útil para manter registro das alterações que são promovidas na base do código do projeto. Ainda dá para ver quem fez cada mudança e recuperar linhas de código que foram deletadas ou alteradas.<br></span><span style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\">&nbsp; &nbsp; &nbsp;Afinal, até após a chegada dos aplicativos e programas ao mercado, é quase regra que os desenvolvedores continuarão lançando&nbsp;</span><i style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\">updates</i><span style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\">, arrumando&nbsp;</span><i style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\">bugs</i><span style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\">&nbsp;e implementando novos recursos.<br></span><span class=\"ez-toc-section\" id=\"O-Que-o-GitHub-Traz-de-Diferente\" style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\"><span style=\"font-weight: 700; margin: 0px; padding: 0px; border: 0px; zoom: 1;\">O Que o GitHub Traz de Diferente?<br></span></span><span style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\">&nbsp; &nbsp; Como o próprio nome já aponta, o grande diferencial do GitHub é que ele acrescenta um&nbsp;<em style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\">hub</em>&nbsp;(ou plataforma) para o sistema de gerenciamento de projetos Git. Basicamente essa diferença faz com que o GitHub seja a maior rede social de desenvolvedores do planeta.<br></span><img src=\"data:image/png;base64,\" data-filename=\"image.png\" style=\"width: 50%;\"><br><span style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\">&nbsp; &nbsp; A plataforma permite que você faça gratuitamente o&nbsp;</span><i style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\">upload</i><span style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\">&nbsp;de seus projetos. Também é possível seguir e acompanhar os principais projetos de desenvolvimento&nbsp;</span><i style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\">open-source</i><span style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\">&nbsp;do mundo com bibliotecas e&nbsp;</span><i style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\">frameworks</i><span style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\">&nbsp;completos para você conferir. Dependendo do seu interesse e do projeto, dá até para reportar&nbsp;</span><i style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\">bugs</i><span style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\">&nbsp;para os desenvolvedores e até mesmo enviar sua própria contribuição com uma correção para o código.<br></span><span style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\">&nbsp; &nbsp; Esse é o grande motivo que torna o GitHub tão popular, já que ele permite que todos os desenvolvedores do time tenham acesso ao código que está sendo desenvolvimento, adicionando seus próprios&nbsp;</span><i style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\">branches</i><span style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\">&nbsp;e&nbsp;</span><i style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\">commits</i><span style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\">.</span></font></h5><h5 style=\"text-align: justify; margin-right: 0px; margin-bottom: 25px; margin-left: 0px; padding: 0px; border: 0px; zoom: 1; line-height: 1.75em; font-family: Roboto, \"><font color=\"#000000\"><b>Fonte: weblink</b></font></h5><p style=\"margin-right: 0px; margin-bottom: 25px; margin-left: 0px; padding: 0px; border: 0px; zoom: 1; line-height: 1.75em; font-family: Roboto, \" open=\"\" sans\",=\"\" helvetica,=\"\" sans-serif;\"=\"\"><span style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\"></span></p><p style=\"margin-right: 0px; margin-bottom: 25px; margin-left: 0px; padding: 0px; border: 0px; zoom: 1; line-height: 1.75em; font-family: Roboto, \" open=\"\" sans\",=\"\" helvetica,=\"\" sans-serif;\"=\"\"><span style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\"></span></p><p style=\"margin-right: 0px; margin-bottom: 25px; margin-left: 0px; padding: 0px; border: 0px; zoom: 1; line-height: 1.75em; font-family: Roboto, \" open=\"\" sans\",=\"\" helvetica,=\"\" sans-serif;\"=\"\"><span style=\"margin: 0px; padding: 0px; border: 0px; zoom: 1;\"></span></p>', '1438668721post1.png', '2020-10-29');

